import React, { Component } from 'react'

export default class Didm extends Component {
    constructor(){
        super()
        this.state = {con:"Hello!!"}
    }
    componentDidMount(){
        setTimeout(() => {
            this.setState({ con: "Welcome !!" });
        }, 2000);
    }



  render() {
    return (
      <div>
        <p>{this.state.con}</p>
      </div>
    )
  }
}
